import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class UserService {

  users: Array<User>;

  constructor() {
    this.users = USERS;
  }

  getUsers(): Array<User> {
    return this.users;
  }

  getUser(id: number): User {
    var userFound: User = null;
    this.users.some((elem, index) => {
      if (elem.id === id) {
        userFound = elem;
        return true;
      }
      return false;
    });
    return userFound;
  }

  getUserByEmail(email: string): User {
    var userFound: User = null;
    this.users.some((elem, index) => {
      if (elem.email === email) {
        userFound = elem;
        return true;
      }
      return false;
    });
    return userFound;
  }

  addUser(user: User) {
    user.id = this.users[this.users.length-1].id+1;
    this.users.push(user);
  }

  updateUser(user: User): User {
    let index = this.users.findIndex(elem => elem.id === user.id);
    if (index > -1) {
      this.users[index] = user;
      return this.users[index];
    } else {
      console.error("On updateUser : the provided userId does not exists.");
      console.error(user);
      console.error("Current users are : ");
      console.error(this.users);
      return null;
    }
  }
}

export class User {
  id: number;
  firstName: string;
  lastName: string;
  email: string;
  profilePicture: string;
  starsAnnouncer: number;
  starsApplicant: number;

  constructor(firstName: string, lastName: string, email: string, profilePicture: string){
    this.firstName = firstName;
    this.lastName = lastName;
    this.email = email;
    this.profilePicture = profilePicture;
    this.starsAnnouncer = 0;
    this.starsApplicant = 0;
  }
}

